import React from 'react';


const ContactPage = () => {
  return (
    <div className="contact-page">
      <div className="form-column">
        
      </div>
      <div className="info-column">
        <h2>Get in Touch</h2>
        <p>
          My name is Thien Nguyen. I have been trained in information technology for 3 years and have experience working in the field of Web processing. Thank you for visiting my Portfolio website. If you have any questions please contact me via email.
        </p>
        <h3>Address</h3>
        <p>123 Main Street, Toronto, ON</p>
        <h3>Email</h3>
        <p>thien@example.com</p>
      </div>
    </div>
  );
};

export default ContactPage;
